import React from 'react'
import { useSelector } from 'react-redux';

const User = () => {
  const isAuth = useSelector(state => state.status);
  const user = useSelector(state => state.user);
  return (
    <div>
      User:
      {console.log(isAuth, user)}
    </div>
  )
}

export default User
